import React from "react";

export const Blog = () => {
  return (
    <div id="page-blog">
      <header className="title-page">
        <h1>Blog</h1>
        <p>
          Check out all the news about Grand Theft Auto
        </p>
      </header>
      <img className="img-blog" src="/images/gta-online-2.png" alt="grand theft auto V Online" />
    </div>
  );
};
